import React from "react";
import { Link } from 'react-router-dom';

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        GuerrierOlen Wedding
      </a>
      <Link to="/rsvp">
          <h1>RSVP</h1>
        </Link>
    </nav>
  );
}

export default Nav;
